css:
.console {
  display: flex;
  flex-direction: column;
  width: 100%;
}
.ui-toolbar {
  background-color: #fff;
}
atom-dock .ui-toolbar,
atom-panel .ui-toolbar {
  background-color: #f4f4f4;
}
.console-body {
  display: flex;
  flex: 1;
  flex-direction: column;
  font-size: 11.7px;
  background-color: #282828;
  line-height: 1.5;
  min-height: 0;
}
.console-lazy-nested-value div,
.console-lazy-nested-value span {
  font-family: Menlo, Monaco, Consolas, "Courier New", monospace;
  white-space: pre-wrap;
  word-break: normal;
  word-wrap: break-word;
}
.console-lazy-nested-value {
  display: flex;
}
.console-lazy-nested-value .list-item::before div {
  display: flex;
}
.console-lazy-nested-value .list-tree li:not(.list-nested-item) {
  line-height: 1.6em;
}
.console-lazy-nested-value div.list-item > div {
  display: inline-block;
}
.console-table-wrapper {
  display: flex;
  flex: 1;
  overflow-x: hidden;
  overflow-y: hidden;
  background-color: #282828;
  -webkit-user-select: text;
}
.console-record {
  display: flex;
  padding: 0.1em 0.5em;
  padding-left: 1em;
  border-radius: 0;
  border-top: 0.1em solid #1b1b1b;
  cursor: text;
  border-left: 5px solid transparent;
  background-color: #282828;
}
.console-record::before {
  width: 0.5em;
  position: absolute;
  left: 0;
  bottom: 0.1em;
  top: 0;
  content: '';
}
.console-record pre,
.console-record code {
  font-size: inherit;
  background-color: transparent;
  word-break: normal;
  white-space: pre-wrap;
}
.console-record .icon {
  font-size: inherit;
  text-align: center;
}
.console-record .icon::before {
  margin-right: 0.5em;
}
.console-record:first-child {
  border-top: none;
}
.console-record:last-child {
  border-bottom: 0.1em solid #1b1b1b;
}
.console-record,
.console-record.console-record.console-record .list-item,
.console-record pre,
.console-record code,
.console-record pre a,
.console-record .console-lazy-nested-value div,
.console-record .console-lazy-nested-value span {
  color: #F8F8F2;
}
.console-record .console-record-duplicate-number {
  background-color: #F8F8F2;
  color: #282828;
}
.console-record:hover {
  background-color: #2d2d2d;
}
