.console-record pre {
  display: inline;
  padding: 0;
  background-color: transparent;
}
.console-record.request {
  display: flex;
  background-color: #282828;
}
.console-record-content-wrapper {
  display: flex;
  width: 100%;
  padding-top: 1px;
  padding-bottom: 1px;
}
.console-record-content-wrapper .ui-lazy-nested-value-treelist li.list-nested-item > .list-item,
.console-record-content-wrapper .ui-lazy-nested-value-treelist .list-item {
  line-height: inherit;
}
.console-record-duplicate-number {
  background: #F8F8F2;
  border-radius: 1em;
  color: #282828;
  display: flex;
  flex-direction: column;
  font-weight: bold;
  height: 1.4em;
  justify-content: center;
  margin-top: auto;
  margin-bottom: auto;
  margin-right: 5px;
  min-width: 1.4em;
  padding: 0 0.4em;
  text-align: center;
}
.console-record-content {
  flex: 1;
}
.console-record-source-label,
.console-record-timestamp {
  align-self: flex-start;
  margin: 2px 0 0 4px;
  white-space: nowrap;
  font-size: 0.8em;
}
span.console-record-source-label,
span.console-record-timestamp {
  padding-top: 0;
  padding-bottom: 0;
}
.console-record-timestamp {
  padding: 1px 2px;
}
.console-input-wrapper {
  display: flex;
  background-color: #282828;
  padding: 0.1em 0;
  flex-grow: 1;
}
.console-input-wrapper atom-text-editor {
  font-size: 11.7px;
}
.console-prompt {
  display: flex;
  padding: 5px 0.5em;
  border-top: 1px solid #eee;
  background-color: #282828;
  color: #F8F8F2;
  min-height: 30px;
  margin-top: auto;
}
.console-multiline-tip {
  padding: 0px 0px 5px 100px;
  font-size: 0.8em;
}
.console-multiline-tip-dim {
  opacity: 0.5;
}
.console-multiline-tip-not-dim {
  opacity: 0.8;
}
.console-prompt-wrapper {
  display: flex;
  align-items: center;
  white-space: nowrap;
}
.console-prompt-label {
  text-transform: uppercase;
  font-weight: bold;
  font-size: 0.8em;
  padding-right: 1em;
}
.console-scroll-pane-wrapper {
  position: relative;
  display: flex;
  flex: 1 0;
  flex-direction: column;
  overflow: hidden;
}
.console-new-messages-notification {
  position: absolute;
  bottom: 0;
  left: 50%;
  text-align: center;
  padding-left: 10px;
  padding-right: 10px;
  cursor: pointer;
  transition: all 0.3s cubic-bezier(0.175, 0.885, 0.32, 1.275);
}
.console-new-messages-notification.visible {
  margin-bottom: 5px;
  transform: translateX(-50%) translateY(0);
}
.console-new-messages-notification:not(.visible) {
  margin-bottom: 0;
  transform: translateX(-50%) translateY(100%);
}
.console-new-messages-notification-icon {
  display: inline-block;
  vertical-align: middle;
  text-align: left;
}
.console-new-messages-notification-icon::before {
  width: auto !important;
}
.console-filtered-reminder {
  display: flex;
  font-style: italic;
}
.console-filtered-reminder a {
  text-decoration: underline;
}
.console-process-control-button {
  transform: translate3d(0, 0, 0);
}
.console-process-starting-spinner {
  margin: 0 0.5em 0 0.5em;
}
.console-table-row-wrapper {
  overflow-x: auto;
  overflow-y: hidden;
  padding-bottom: 3px;
}
.nuclide-console-default-text-colors {
  color: #F8F8F2;
}
